import React from "react";
import {Link} from "react-router-dom";

// reactstrap components
import { Button, Container } from "reactstrap";

// core components

function AdminLandingPageHeader() {
  let pageHeader = React.createRef();

  React.useEffect(() => {
    if (window.innerWidth < 991) {
      const updateScroll = () => {
        let windowScrollTop = window.pageYOffset / 3;
        pageHeader.current.style.transform =
          "translate3d(0," + windowScrollTop + "px,0)";
      };
      window.addEventListener("scroll", updateScroll);
      return function cleanup() {
        window.removeEventListener("scroll", updateScroll);
      };
    }
  });

  return (
    <>
      <div
        style={{
          backgroundImage: "url(" + require("assets/img/Programmers/Gym/GymWall2.jpg") + ")"
        }}
        className="page-header"
        data-parallax={true}
        ref={pageHeader}
      >
        <div className="filter" />
        <Container>
          <div className="motto text-center">
            <h1>Gymnious App</h1>
            <h3>You lift the weight. We carry the burden.</h3>
            <br />
            <Link to="/LandingPage">
            <Button
              className="btn-round mr-1"
              color="neutral"
              target="_blank"
              outline
            >
              Check All Training Schedules
            </Button>
            </Link>
            <Link to="/LandingPage">
            <Button
              className="btn-round mr-1"
              color="neutral"
              target="_blank"
              outline
            >
              Check All Classes
            </Button>
            </Link>
            <Link to="/LandingPage">
            <Button
              className="btn-round mr-1"
              color="neutral"
              target="_blank"
              outline
            >
              Check Trainers
            </Button>
            </Link>
            <Link to="/LandingPage">
            <Button
              className="btn-round mr-1"
              color="neutral"
              target="_blank"
              outline
            >
              Check Who Needs a Trainer
            </Button>
            </Link>
            <Link to="/LandingPage">
            <Button
              className="btn-round mr-1"
              color="neutral"
              target="_blank"
              outline
            >
              Check Athletes
            </Button>
            </Link>
            <Link to="/LandingPage">
            <Button
              className="btn-round mr-1"
              color="neutral"
              target="_blank"
              outline
            >
              Check Billing
            </Button>
            </Link>
          </div>
        </Container>
      </div>
      <div className="footer register-footer text-center">
          <h6>© {new Date().getFullYear()}, Powered by NumSay.</h6>
    </div>
    </>
  );
}

export default AdminLandingPageHeader;
